{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/nicoelbert/ais22-w11-deep-learning?scriptVersionId=101318411\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.042411,"end_time":"2022-07-20T11:59:35.068849","exception":false,"start_time":"2022-07-20T11:59:35.026438","status":"completed"},"slideshow":{"slide_type":"subslide"},"tags":[]},"source":["*Analytical Information Systems*\n","\n","# Worksheet 11 - Deep Learning\n","\n","Nico Elbert, Matthias Griebel<br>\n","Lehrstuhl f√ºr Wirtschaftsinformatik und Informationsmanagement\n","\n","SS 2022\n","\n","***\n","\n","# Table of Contents\n","\n","* [1. AI Accelerators](#acc)\n","    * [1.1. Datasets](#ds)\n","    * [1.2. Algorithms](#alg)\n","    * [1.2. Hardware](#hw)\n","* [2. Deep Learning with Keras in R](#keras)\n","    * [2.1. Image Classification](#class)  \n","    * [2.2. Text Classification](#text)  \n","* [3. Exercises](#exercises)\n","    * [3.1. Exam Questions](#exam)  \n","*** \n","\n","## 1. AI Accelerators<a id=\"acc\"></a>\n","\n","__WIRED: The three breakthroughs that have finally unleashed A.I. on the world!__\n","<img src=\"https://github.com/matjesg/AIS_2019/raw/master/notebooks/images/08/accelerators.png\" style='width:80%'>\n","\n","In this worksheeet, we will have a quick look at these components and get some deep learning experience in R.\n","\n","## 1.1. Popular Datasets for Deep Learning (not always Big Data)<a id=\"ds\"></a>\n","\n","**Image Data Sets**\n","\n","[__MNIST__](http://yann.lecun.com/exdb/mnist/)\n","\n","<img src=\"https://upload.wikimedia.org/wikipedia/commons/2/27/MnistExamples.png\" style='width:40%'>\n","\n","- Large database of handwritten digits\n","- 70,000 images in 10 classes\n","    - 60k training images\n","    - 10k testing images\n","- Size: ~50 MB\n","    \n","\n","It is a good database for trying learning techniques and pattern recognition methods on real-world data while spending minimal efforts on preprocessing and formatting.\n","\n","*** \n","\n","\n","[Fashion MNIST](https://github.com/zalandoresearch/fashion-mnist) data set\n","\n","<img src='https://keras.rstudio.com/articles/images/fashion_mnist.png' style='width:40%'>\n","\n","- 70,000 grayscale images in 10 categories\n","    - 60k training images\n","    - 10k testing images\n","- The images show individual articles of clothing at low resolution (28 by 28 pixels)\n","\n","\n","_Why Fashion MNIST?_:\n","Fashion MNIST is a slightly more challenging problem than regular MNIST. \n","\n","*** \n","\n","<img src=\"https://s3-ap-south-1.amazonaws.com/av-blog-media/wp-content/uploads/2018/03/ImageNet.png\" align='right' style='width:60%'>\n","\n","[__ImageNet__](http://www.image-net.org)\n","\n","- Designed for use in visual object recognition software research\n","- ~1,500,000 images, each with multiple __bounding boxes__ and respective class labels\n","- Size: ~150GB\n","\n","Since 2010, the ImageNet project runs an annual software contest, the ImageNet Large Scale Visual Recognition Challenge (ILSVRC). \n","\n","Modern deep learning was born on 30 September 2012, when a convolutional neural network (CNN) called AlexNet achieved a top-5 error of 15.3% in the ImageNet 2012 Challenge.\n","\n","\n","*** \n","\n","<img src=\"https://s3-ap-south-1.amazonaws.com/av-blog-media/wp-content/uploads/2018/03/coco.jpg\" align='right' style='width:60%'>\n","\n","[__MS-COCO__](http://cocodataset.org/#home)\n","\n","- Designed for object detection, segmentation and captioning\n","- ~ 30K images\n","    - 80 object categories, \n","    - 5 captions per image, \n","    - 250,000 people with key points\n","- Size: ~25 GB (Compressed)\n","\n","*** \n","\n","**Natural Language Processing Data Sets**\n","\n","<img src=\"https://m.media-amazon.com/images/G/01/imdb/images-ANDW73HA/imdb_fb_logo._CB1542065250_.png\" align='right' style='width:20%'>\n","\n","\n","[__IMDB Reviews__](http://cocodataset.org/#home)\n","\n","- Contains movie reviews along with their associated binary sentiment polarity labels\n","- 50,000 reviews \n","    - 25k highly polar movie reviews for training\n","    - 25k for testing\n","- Size: ~80 MB\n","\n","\n","It is intended to serve as a benchmark for sentiment classification. \n","\n","More NLP data sets: [Twenty Newsgroups](https://archive.ics.uci.edu/ml/datasets/Twenty+Newsgroups), [Sentiment140](http://help.sentiment140.com/for-students/), [WordNet](https://wordnet.princeton.edu/), [Yelp Reviews](https://www.yelp.com/dataset)\n","\n","*** \n","\n","**Audio/Speech Datasets**\n","\n","[__Free Spoken Digit Dataset__](https://github.com/Jakobovski/free-spoken-digit-dataset)\n","\n","- Created to solve the task of identifying spoken digits in audio samples\n","- 1,500 recordings (50 of each digit per speaker)\n","    - 3 speakers\n","- English pronunciations\n","- Size: ~10 MB\n","\n","It is intended to serve as a benchmark for sentiment classification. \n","\n","Other data sets\n","- [Free Music Archive (FMA)](https://github.com/mdeff/fma)\n","- [Ballroom](http://mtg.upf.edu/ismir2004/contest/tempoContest/node5.html)\n","\n","*** \n","\n","### 1.2. New Algorithmic Components<a id=\"alg\"></a>\n","\n","**DL Architectures**\n","\n","- Convolutional Neural Networks (CNN)\n","- Long Short Term Memory (LSTM)\n","- Auto encoder hierarchies\n","- Transformers/Attention \n","\n","and more...\n","\n","__CNN Architecture Comparison on ImageNet__\n","\n","<img src=\"https://miro.medium.com/max/700/1*ZqkLRkMU2ObOQWIHLBg8sw.png\" style='width:70%'>\n","\n","\n","**Deep Learning Frameworks**\n","\n","- Deep learning frameworks offer building blocks for designing, training and validating deep neural networks\n","- Allows for easy and fast prototyping\n","\n","<img src=\"https://miro.medium.com/max/700/1*s_BwkYxpGv34vjOHi8tDzg.png\" style='width:50%'>\n","\n","[Source](https://towardsdatascience.com/deep-learning-framework-power-scores-2018-23607ddf297a)\n","\n","_Deep learning frameworks are changing rapidly_\n","\n","\n","**FastAi and PyTorch Lightning**\n","\n","https://course.fast.ai/\n","https://github.com/fastai/fastbook\n","\n","https://pytorch-lightning.readthedocs.io/en/stable/"]},{"cell_type":"code","execution_count":1,"metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-07-20T11:59:35.192929Z","iopub.status.busy":"2022-07-20T11:59:35.190827Z","iopub.status.idle":"2022-07-20T11:59:35.323839Z","shell.execute_reply":"2022-07-20T11:59:35.323227Z"},"papermill":{"duration":0.213844,"end_time":"2022-07-20T11:59:35.323989","exception":false,"start_time":"2022-07-20T11:59:35.110145","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABIQAAAIeCAYAAADK/9QpAAABRmlDQ1BJQ0MgUHJvZmlsZQAA\nKJFjYGASSSwoyGFhYGDIzSspCnJ3UoiIjFJgf8rAzsAIxCoM8onJxQWOAQE+QCUMMBoVfLsG\nVAsEl3VBZpkefuj9/A/nxuuTOKvPFGZ1YqpHAVwpqcXJQPoPEKclFxSVMDAwpgDZyuUlBSB2\nB5AtUgR0FJA9B8ROh7A3gNhJEPYRsJqQIGcg+waQLZCckQg0g/EFkK2ThCSejsSG2gsCPD7u\nCh4uQQrhgR4uBJxLOihJrSgB0c75BZVFmekZJQqOwFBKVfDMS9bTUTAyMDJkYACFOUT150Bw\nWDKKnUGI5S9iYLD4ysDAPAEhljSTgWF7KwODxC2EmMoCBgb+FgaGbecLEosS4Q5g/MZSnGZs\nBGHzODEwsN77//+zGgMD+2QGhr8T/v//vej//7+LgebfYWA4kAcAk1xh1bab84oAAABiZVhJ\nZk1NACoAAAAIAAIBEgADAAAAAQABAACHaQAEAAAAAQAAACYAAAAAAAOShgAHAAAAEgAAAFCg\nAgAEAAAAAQAABISgAwAEAAAAAQAAAh4AAAAAQVNDSUkAAABTY3JlZW5zaG90mIOFfQAAAj5p\nVFh0WE1MOmNvbS5hZG9iZS54bXAAAAAAADx4OnhtcG1ldGEgeG1sbnM6eD0iYWRvYmU6bnM6\nbWV0YS8iIHg6eG1wdGs9IlhNUCBDb3JlIDYuMC4wIj4KICAgPHJkZjpSREYgeG1sbnM6cmRm\nPSJodHRwOi8vd3d3LnczLm9yZy8xOTk5LzAyLzIyLXJkZi1zeW50YXgtbnMjIj4KICAgICAg\nPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9IiIKICAgICAgICAgICAgeG1sbnM6ZXhpZj0i\naHR0cDovL25zLmFkb2JlLmNvbS9leGlmLzEuMC8iCiAgICAgICAgICAgIHhtbG5zOnRpZmY9\nImh0dHA6Ly9ucy5hZG9iZS5jb20vdGlmZi8xLjAvIj4KICAgICAgICAgPGV4aWY6UGl4ZWxZ\nRGltZW5zaW9uP