cessing unit) are well suited for Deep Learning \n","     - Efficient for matrix multiplication and convolution (parallelized operations)\n","     - Sequential code is still faster on CPUs\n","     \n","- __TPUs__ (tensor processing units) are specifically designed for neural network machine learning\n","\n","<img src=\"https://cloud.google.com/images/products/tpu/machine-learning-performance.png\" style='width:50%'>\n","\n","## 2. Deep Learning with Keras in R<a id=\"keras\"></a>\n","\n","### 2.1. Image classification<a id=\"class\"></a> \n","\n","__We will train a neural network model to classify images of clothing, like sneakers and shirts__\n","\n","The code is adopted from https://keras.rstudio.com/articles/tutorial_basic_classification.html.\n","\n","First, we need to load the required R packages"]},{"cell_type":"code","execution_count":2,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:59:35.70489Z","iopub.status.busy":"2022-07-20T11:59:35.665881Z","iopub.status.idle":"2022-07-20T11:59:37.854982Z","shell.execute_reply":"2022-07-20T11:59:37.853377Z"},"papermill":{"duration":2.277765,"end_time":"2022-07-20T11:59:37.855262","exception":false,"start_time":"2022-07-20T11:59:35.577497","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["‚îÄ‚îÄ \u001b[1mAttaching packages\u001b[22m ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ tidyverse 1.3.0 ‚îÄ‚îÄ\n","\n","\u001b[32m‚úî\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.2.\u001b[31m9000\u001b[39m     \u001b[32m‚úî\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4     \n","\u001b[32m‚úî\u001b[39m \u001b[34mtibble \u001b[39m 3.0.2          \u001b[32m‚úî\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.0     \n","\u001b[32m‚úî\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.0          \u001b[32m‚úî\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0     \n","\u001b[32m‚úî\u001b[39m \u001b[34mreadr  \u001b[39m 1.3.1          \u00