1:59:50.691772","status":"completed"},"slideshow":{"slide_type":"subslide"},"tags":[]},"source":["**Build the Model**\n","\n","Building the neural network in Keras requires configuring the layers of the model, then compiling the model.\n","\n","\n","_Setup the layers_\n","\n","The basic building block of a neural network is the layer. Layers extract representations from the data fed into them. And, hopefully, these representations are more meaningful for the problem at hand.\n","\n","Most of deep learning consists of chaining together simple layers. Most layers, like `layer_dense` and `conv_layers`, have parameters that are learned during training.\n"]},{"cell_type":"code","execution_count":17,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:59:50.860438Z","iopub.status.busy":"2022-07-20T11:59:50.858922Z","iopub.status.idle":"2022-07-20T11:59:53.700039Z","shell.execute_reply":"2022-07-20T11:59:53.698732Z"},"papermill":{"duration":2.898597,"end_time":"2022-07-20T11:59:53.700206","exception":false,"start_time":"2022-07-20T11:59:50.801609","status":"completed"},"tags":[]},"outputs":[],"source":["model <- keras_model_sequential()\n","model %>%\n","    layer_conv_2d(filters = 32, kernel_size = c(3,3), activation = 'relu', input_shape = c(28, 28, 1)) %>%\n","    layer_max_pooling_2d(pool_size = c(2,2)) %>%\n","    layer_flatten() %>%\n","    layer_dense(units = 128, activation = 'relu') %>%\n","    layer_dropout(rate = 0.5) %>%\n","    layer_dense(units = 10, activation = 'softmax')"]},{"cell_type":"code","execution_count":18,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:59:53.817992Z","iopub.status.busy":"2022-07-20T11:59:53.816386Z","iopub.status.idle":"2022-07-20T11:59:53.834997Z","shell.execute_reply":"2022-07-20T11:59:53.833575Z"},"papermill":{"duration":0.079656,"end_time":"2022-07-20T11:59:53.835119","exception":false,"start_time":"2022-07-20T11:59:53.755463","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"st