ng. We want to minimize this function to \"steer\" the model in the right direction.\n","- __Optimizer__ - This is how the model is updated based on the data it sees and its loss function.\n","- __Metrics__ - Used to monitor the training and testing steps. The following example uses accuracy, the fraction of the images that are correctly classified."]},{"cell_type":"code","execution_count":19,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:59:54.095487Z","iopub.status.busy":"2022-07-20T11:59:54.093976Z","iopub.status.idle":"2022-07-20T11:59:54.142166Z","shell.execute_reply":"2022-07-20T11:59:54.140988Z"},"papermill":{"duration":0.107648,"end_time":"2022-07-20T11:59:54.142312","exception":false,"start_time":"2022-07-20T11:59:54.034664","status":"completed"},"tags":[]},"outputs":[],"source":["model %>% compile(\n","    loss = 'sparse_categorical_crossentropy',\n","    optimizer = 'adam', \n","    metrics = c('accuracy')\n",") "]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.058918,"end_time":"2022-07-20T11:59:54.258022","exception":false,"start_time":"2022-07-20T11:59:54.199104","status":"completed"},"tags":[]},"source":["**Loss Functions and Optimizers**"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.065608,"end_time":"2022-07-20T11:59:54.390218","exception":false,"start_time":"2022-07-20T11:59:54.32461","status":"completed"},"tags":[]},"source":["\n","![3blue1brown video edited by Caspar Hansen](https://mlfromscratch.com/content/images/2019/12/gradient-descent-optimized--1-.gif)\n","\n","Source: 3blue1brown video annotated by [mlfromscratch](https://mlfromscratch.com/optimizers-explained/#/)\n","\n","\n","![Comparison of many optimizers. Credits to Ridlo Rahman](https://mlfromscratch.com/content/images/2019/12/saddle.gif)\n","\n","Comparison of many optimizers. Credits to [Ridlo Rahman](https://rnrahman.com/blog/visualising-stochastic-optimisers/)"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.088941,"end_time":"2022-07-20T11:59:54.578744","exception":false,"start_time":"2022-07-20T11:59:54.489803","status":"completed"},"slideshow":{"slide_type":"subslide"},"tags":[]},"source":["**Train the Model**\n","\n","Training the neural network model requires the following steps:\n","\n"," - Feed the training data to the model ‚Äî in this example, the `train_images` and `train_labels` arrays.\n"," - The model learns to associate images and labels.\n"," - We ask the model to make predictions about a test set ‚Äî in this example, the test_images array. We verify that the predictions match the labels from the test_labels array.\n","\n","To start training, call the `fit` method ‚Äî the model is \"fit\" to the training data:"]},{"cell_type":"code","execution_count":20,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T11:59:54.766276Z","iopub.status.busy":"2022-07-20T11:59:54.763648Z","iopub.status.idle":"2022-07-20T12:00:48.455074Z","shell.execute_reply":"2022-07-20T12:00:48.453754Z"},"papermill":{"duration":53.790078,"end_time":"2022-07-20T12:00:48.455312","exception":false,"start_time":"2022-07-20T11:59:54.665234","status":"completed"},"tags":[]},"outputs":[],"source":["history <- model %>% fit(x_train, train_labels, epochs = 10)"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.055591,"end_time":"2022-07-20T12:00:48.570288","exception":false,"start_time":"2022-07-20T12:00:48.514697","status":"completed"},"slideshow":{"slide_type":"subslide"},"tags":[]},"source":["Plot training history"]},{"cell_type":"code","execution_count":21,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T12:00:48.684395Z","iopub.status.busy":"2022-07-20T12:00:48.682843Z","iopub.status.idle":"2022-07-20T12:00:49.041762Z","shell.execute_reply":"2022-07-20T12:00:49.040952Z"},"papermill":{"duration":0.416627,"end_time":"2022-07-20T12:00:49.041891","exception":false,"start_time":"2022-07-20T12:00:48.625264","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","outp