n":false,"start_time":"2022-07-20T12:01:04.727187","status":"completed"},"tags":[]},"source":["**Prepare the data**\n","\n","The reviews ‚Äî the arrays of integers ‚Äî must be converted to tensors before fed into the neural network. \n","\n","Here, we will pad the arrays so they all have the same length, then create an integer tensor of shape num_examples * max_length. We can use an embedding layer capable of handling this shape as the first layer in our network.\n","\n","\n","Since the movie reviews must be the same length, we will use the pad_sequences function to standardize the lengths:"]},{"cell_type":"code","execution_count":38,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T12:01:04.929183Z","iopub.status.busy":"2022-07-20T12:01:04.927584Z","iopub.status.idle":"2022-07-20T12:01:06.548087Z","shell.execute_reply":"2022-07-20T12:01:06.546618Z"},"papermill":{"duration":1.689577,"end_time":"2022-07-20T12:01:06.54827","exception":false,"start_time":"2022-07-20T12:01:04.858693","status":"completed"},"tags":[]},"outputs":[],"source":["train_data <- pad_sequences(\n","  train_data,\n","  value = word_index_df %>% filter(word == \"<PAD>\") %>% select(idx) %>% pull(),\n","  padding = \"post\",\n","  maxlen = 256\n",")\n","\n","test_data <- pad_sequences(\n","  test_data,\n","  value = word_index_df %>% filter(word == \"<PAD>\") %>% select(idx) %>% pull(),\n","  padding = \"post\",\n","  maxlen = 256\n",")"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.074045,"end_time":"2022-07-20T12:01:06.689572","exception":false,"start_time":"2022-07-20T12:01:06.615527","status":"completed"},"tags":[]},"source":["Let‚Äôs look at the length of the examples now:"]},{"cell_type":"code","execution_count":39,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T12:01:06.82521Z","iopub.status.busy":"2022-07-20T12:01:06.823723Z","iopub.status.idle":"2022-07-20T12:01:06.850581Z","shell.execute_reply":"2022-07-20T12:01:06.849376Z"},"papermill":{"duration":0.095805,"end_time":"2022-07-20T12:01:06.850672","exception":false,"start_time":"2022-07-20T12:01:06.754867","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["256"],"text/latex":["256"],"text/markdown":["256"],"text/plain":["[1] 256"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["256"],"text/latex":["256"],"text/markdown":["256"],"text/plain":["[1] 256"]},"metadata":{},"output_type":"display_data"}],"source":["length(train_data[1, ])\n","length(train_data[2, ])"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.066873,"end_time":"2022-07-20T12:01:06.98462","exception":false,"start_time":"2022-07-20T12:01:06.917747","status":"completed"},"tags":[]},"source":["**Build the model**\n","\n","The neural network is created by stacking layers ‚Äî this requires two main architectural decisions:\n","\n","- How many layers to use in the model?\n","- How many hidden units to use for each layer?\n","\n","In this example, the input data consists of an array of word-indices. The labels to predict are either 0 or 1. Let‚Äôs build a model for this problem:"]},{"cell_type":"code","execution_count":40,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T12:01:07.12358Z","iopub.status.busy":"2022-07-20T12:01:07.122087Z","iopub.status.idle":"2022-07-20T12:01:07.187455Z","shell.execute_reply":"2022-07-20T12:01:07.186171Z"},"papermill":{"duration":0.135683,"end_time":"2022-07-20T12:01:07.187554","exception":false,"start_time":"2022-07-20T12:01:07.051871","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Model: \"sequential_1\"\n","________________________________________________________________________________\n","Layer (type)                        Output Shape                    Param #     \n","================================================================================\n","embedding (Embedding)               (None, None, 16)                160000      \n","________________________________________________________________________________\n","global_average_pooling1d (GlobalAve (None, 16)                      0           \n","________________________________________________________________________________\n","dense_2 (Dense)                     (None, 16)                      272         \n","________________________________________________________________________________\n","dense_3 (Dense)                     (None, 1)                       17          \n","================================================================================\n","Total params: 160,289\n","Trainable params: 160,289\n","Non-trainable params: 0\n","________________________________________________________________________________\n"]}],"source":["# input shape is the vocabulary count used for the movie reviews (10,000 words)\n","vocab_size <- 10000\n","\n","model <- keras_model_sequential()\n","model %>% \n","  layer_embedding(input_dim = vocab_size, output_dim = 16) %>%\n","  layer_global_average_pooling_1d() %>%\n","  layer_dense(units = 16, activation = \"relu\") %>%\n","  layer_dense(units = 1, activation = \"sigmoid\")\n","\n","model %>% summary()"]},{"cell_type":"markdown","metadata":{"papermill":{"duration":0.066751,"end_time":"2022-07-20T12:01:07.322169","exception":false,"start_time":"2022-07-20T12:01:07.255418","status":"completed"},"tags":[]},"source":["**Additional Model Information**\n","\n","The layers are stacked sequentially to build the classifier:\n","\n","- The first layer is an embedding layer. This layer takes the integer-encoded vocabulary and looks up the embedding vector for each word-index. These vectors are learned as the model trains. The vectors add a dimension to the output array. The resulting dimensions are: (batch, sequence, embedding).\n","- Next, a global_average_pooling_1d layer returns a fixed-length output vector for each example by averaging over the sequence dimension. This allows the model to handle input of variable length, in the simplest way possible.\n","- This fixed-length output vector is piped through a fully-connected (dense) layer with 16 hidden units.\n","- The last layer is densely connected with a single output node. Using the sigmoid activation function, this value is a float between 0 and 1, representing a probability, or confidence level.\n","\n","__Hidden units__\n","The above model has two intermediate or ‚Äúhidden‚Äù layers, between the input and output. The number of outputs (units, nodes, or neurons) is the dimension of the representational space for the layer. In other words, the amount of freedom the network is allowed when learning an internal representation.\n","\n","If a model has more hidden units (a higher-dimensional representation space), and/or more layers, then the network can learn more complex representations. However, it makes the network more computationally expensive and may lead to learning unwanted patterns ‚Äî patterns that improve performance on training data but not on the test data. This is called overfitting, and we‚Äôll explore it later.\n","\n","__Loss function and optimizer__\n","A model needs a loss function and an optimizer for training. Since this is a binary classification problem and the model outputs a probability (a single-unit layer with a sigmoid activation), we‚Äôll use the binary_crossentropy loss function.\n","\n","This isn‚Äôt the only choice for a loss function, you could, for instance, choose mean_squared_error. But, generally, binary_crossentropy is better for dealing with probabilities ‚Äî it measures the ‚Äúdistance‚Äù between probability distributions, or in our case, between the ground-truth distribution and the predictions.\n","\n","\n","Now, configure the model to use an optimizer and a loss function:"]},{"cell_type":"code","execution_count":41,"metadata":{"execution":{"iopub.execute_input":"2022-07-20T12:01:07.460387Z","iopub.status.busy":"2022-07-20T12:01:07.458904Z","iopub.status.idle":"2022-07-20T12:01:07.502822Z","shell.ex